import React from "react";
import Navbar from "react-bootstrap/Navbar"
import Bnav from "react-bootstrap/Nav"
import Link from "react-router-dom/Link"

function Nav() {
  return (
    <Navbar>
      <Bnav.Link ><Link to="/searchbooks"></Link>
      <Link to="/savedbooks">Search</Link></Bnav.Link>
      <Bnav.Link ><Link to="/searchbooks"></Link>
      <Link to="/savedbooks">Saved Books</Link></Bnav.Link>
    </Navbar>
  );
}

export default Nav;
